- proto: BookBase
  entities:
  - uid: 16931
    components:
    - type: MetaData
      desc: Краткое пособие как правильно губить цивилизации.
      name: книга о Ядерном Оружии
    - type: Transform
      pos: -20.798798,49.363525
      parent: 13781
    - type: Paper
      content: "Автор книги: Маркус Де Ларго, Ядерный энергетик, бывший Заместитель научно-исследовательского Института, разработчик проекта \"Туман\". \n\nДата выпуска книги: 23.05.2650.\n\n1. Вступление.\n2. Описание.\n3. Принцип действия.\n4. Конструкция.\n\nВступление.\n\nДанное пособие не является руководством по созданию ядерного оружия. Вы не должны пытаться воссоздать подобное не являясь целой корпорацией или государством. \nПопытки воссоздать что-либо из данной книги может привести к вашей смерти.\n\nОписание.\nЯдерное оружие класса Б - разновидность лёкого ядерного оружия, которое может быть применено и использовано в космосе на судне любого типа и любого предназначения. Выделяется особой практичностью и компактными размерами. Несмотря на внешние данные, обладает достаточной мощностью чтобы уничтожать крупные космические объекты и поражать цели в огромном радиусе на планетах. \nШироко использовались силами ОПЗ при войне с ксеноморфами в 2600-х годах. \nНа данный момент размещены на всех крупных научно-исследовательских станциях корпорации NanoTrasen для неизвестных целей, ввиду безопасности зон в которых они находятся.\n\nПринцип действия.\n\nОсновой ядерной боеголовки этого типа является плутониевое ядро, которое вступает в реакцию со специальным ударником с пластитановым наконечником имеющим на своём конце отверстие. Он натягивается по мере истечения времени на таймере, потому время до детонации не может быть увеличено даже при обезвреживании боеголовки. В момент, когда таймер достигает нуля - ударник лишается предохранителя и с примерной силой в две тонны пробивает ядро, выпуская частицы которые вступают в контакт с сердцевиной ядра и разрушив его провоцирует мощный взрыв. \nДанное действие происходит меньше чем за десятую долю секунды, что происходит быстрее чем таймер останавливается при обезвреживании, потому случаев, когда таймер достиг нуля и бомбу обезвредили не существует. \nНесмотря на использование радиоактивных элементов - зоны поражения не окружены радиацией, а те, кто находились на достаточном расстоянии не страдают от излишнего излучения.\nВсю смертность составляет огромная температура, давление и ударная волна которая распространяет огонь от реакции по всей зоне поражения буквально разрывая на части тех кто в неё попал и сжигая остатки.\n\nКонструкция. \n\nКорпус состоит из специально подготовленного сплава стали и пластали также имеющего пластиковое покрытие с тонким экранированием из стальных сеток, благодаря чему боеголовку неразрушить даже мощными строительными инструментами из-за гибкости конструкции и материала. Данный сплав примерно 40 сантиметров из-за чего на корпусе могут остаться лишь вмятины. \nВнутреняя часть состоит из вышеуказанного ударного механизма, в котором обычно находится обратный уран-231, который можно получить обработав урановую руду. \nПлутониевое ядро скрыто в корпусе имеющим пластитановое покрытие которое обволакивает особый корпус, который создаётся по принципу гермозатворов, что обеспечивает отсутствие риска распада ядерных материалов и излучения радиации.\nДля того, чтобы таймер работал - ударный механизм обладает предохранителем. Предохранитель состоит из двух пластин, между которым находятся пружины которые постоянно стремятся разжаться. Благодаря их очень плотной конструкции и толщине, они могут сдержать ударник при ложном срыве при натягивании. При детонации пружины всё ещё работают. Сам ударный механизм запечатан в пластинах, благодаря чему ударник врежется в заднюю пластину всё ещё будучи закрытым в передней  из-за чего даже при пробитии задней пластины детонации не произойдёт, а пружины оттолкнут ударник обратно. При обнулении таймер пластины раскрываются и в таком случае пружины не станут помехой.\n\nПару десятков минут с кистью и краской - и вот, ядерная боеголовка как оригинал!\nВовремя этого процесса, на производстве почти всегда находится промышленный счётчик Гейгера который сканирует и сообщает о малейших отклонениях в радиационном фоне. Если при завершении конструкции радиационный фон остаётся - она признаётся дефектной и подлежит пересбору. Сам процесс пересбора является очень трепетным, ввиду опасности детонации механизма при неверном обращении.\n\n\n\n \n"
